import Nav from './Nav'
import '../css/main.css'
import '../css/reset.css'
import Footer from './Footer'

const Layout = (props) => {
    return (
        <div className="container">
            <Nav/>
            <div className="content">
                {props.children}
            </div>
            <div className="footer-line"></div>
            <Footer/>
        </div>
    )
}

export default Layout;
